function saveAs(data, fileName) {
    const a = document.createElement("a");
    const url = URL.createObjectURL(data);
    a.href = url;
    a.download = fileName;
    document.body.appendChild(a);
    a.click();
    setTimeout(function () {
            document.body.removeChild(a);
            window.URL.revokeObjectURL(url);
        },
        0);
}

const writeExcel = (data, fileName, columns, brand) => {
    const wb = new Excel.Workbook();
    wb.creator = 'BB';
    wb.modified = new Date();
    const ws = wb.addWorksheet('Main', {
        pageSetup: {paperSize: data.length, orientation: 'landscape', fitToPage: true},
    });
    ws.state = 'visible';

    ws.columns = columns.map((col, i) => {
        const style = {alignment: {wrapText: true, horizontal: 'center'}};

        const wideCols = [
            'ACCROCHE PRODUIT',
            'DESCRIPTION OF PRODUCT',
            'COMPOSITION DETAILE ',
            'DETAILED COMPOSITION',
            'FICHE GARANTIE',
            'DESCRIPTION FOR PRODUCTION',
            'DESCRIPTION OF BRAND / BASE LINE',
        ];

        if (wideCols.includes(col)) {
            return {key: col, width: 150, style}
        } else if (i === 42) {
            // warranty
            return {key: col, width: 150, style}
        }

        return {key: col, width: 50, style}
    });


    ws.getRow(2).values = columns;
    ws.getRow(1).values = [brand, ..._.times(columns.length - 1, () => ' ')];
    ws.addRows(data);
    ws.getRow(1).fill = {
        type: 'pattern',
        pattern: 'darkTrellis',
        fgColor: {argb: '204E78'},
        bgColor: {argb: '204E78'},
    };
    ws.getRow(2).fill = {
        type: 'pattern',
        pattern: 'darkTrellis',
        fgColor: {argb: '204E78'},
        bgColor: {argb: '204E78'},
    };
    ws.getRow(2).font = {
        color: {argb: 'FFFFFFFF'},
        bold: true,
        size: 14,
    };
    ws.getRow(1).font = {
        color: {argb: 'FFFFFFFF'},
        bold: true,
        size: 16,
    };

    data.forEach((item, i) => {
        const imageIds = {
            [i]: wb.addImage({
                base64: getBase64Image(encodeURI(item['LINK PHOTO'])),
                extension: 'jpeg',
            })
        };

        ws.addImage(imageIds[i], {
            tl: {col: 4.2, row: i * 10.43 + 4.5},
            br: {col: 5.2, row: i},
            editAs: 'absolute',
            // ext: {width: 200, height: 250},
        });
    });


    const date = new Date();
    const day = date.getDay() < 10 ? `0${date.getDay()}` : date.getDay();
    const month = date.getMonth() < 10 ? `0${date.getMonth()}` : date.getMonth();
    const year = date.getFullYear();
    const fullDate = `${day}.${month}.${year}`;

    wb.xlsx.writeBuffer().then(buf => {
        const blob = new Blob([buf], {type: "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet"});
        saveAs(blob, `B&B_ficher_offre_${brand}_(${fullDate}).xlsx`);
    }).catch(console.error);
};

export default writeExcel;
